import axios from "axios";

const url = "http://localhost:8000";

export default register = (data) => {
  return (dispatch) => {
    axios
      .post(`${url}/users/register`, data)
      .then((response) => {
        dispatch({
          type: "REGISTER",
          payload: response.data,
        });
      })
      .catch((error) => {
        throw error;
      });
  };
};
